import axios from 'axios';
import React, { useEffect, useState } from 'react'

interface User {
	user_id: number,
	username: string,
	email: string,
	sold: number,
}

function initialState(): User[] {
	return []
}

function Profile({user_id, username, email, sold}: User) {
	return (
		<div>
			<span>{user_id}</span>
			<span>{user_id}</span>
			<span>{user_id}</span>
			<span>{user_id}</span>
		</div>
	)
}

export const Users = () =>{

	const [users, setUsers] = useState(() => initialState());

	useEffect(() =>  {
		fetch('http://localhost:8080/users/')
			.then((data) => data.json())
			.then((json: User[]) => {
				// const data = JSON.stringify(json);
				setUsers(json);
				console.log("data received: ", json);
			})
	}, [])

	return (
		<aside>
			<h2>Users</h2>
			<p>
				{users.map((user) => <li key={user.user_id}>{user.username}</li>)}
			</p>
		</aside>
	)
}
